import React, { Component } from 'react';
import Input from '../../form/input/input.js';
import Hsecondary from "../../heading-secondary/h-secondary.js";
import BtnAn from "../../button/btn-an.js";
import "./loginpage.scss";

class Loginpage extends Component {
    state = {
        formfront: "login",
    } 

    formChangedHandler = (event) => {
        console.log(event.target.id);
        this.setState({formfront: event.target.id})
    }

    render () {
        return (
            <div className="loginpage">
                <input
                    className="loginpage-input"
                    type="radio"
                    value="login"
                    name="loginpage"
                    id="login"
                / >
                <label
                    className="loginpage-label"
                    htmlFor="login"
                >
                    Login
                </label>
                <input
                    className="loginpage-input"
                    type="radio"
                    value="signup"
                    name="loginpage"
                    id="signup"
                / >
                <label
                    className="loginpage-label"
                    htmlFor="signup"
                >
                    Signup
                </label>
            </div>
        );
    }
}

export default Loginpage;
